import "./afterSearch.scss";
import loqo from "../assets/loqob.png";
import times from "../assets/cancel.png";
import { Link, withRouter } from "react-router-dom";
import $ from "jquery";
import { connect } from "react-redux";


function afterSearch ({ search = [] }) {
  return (
    
    <div id="up" className="afterSearch">
    <div className="title">Axtarışa uyğun nəticələr</div>
    {
     search.map((search1) => {
      return(
      <>
      <Link to={{ pathname:search1.link,hash:search1.hash}} className="item" >  {search1.title} </Link>


      </>

      )
     })
    }
    
    </div>
  );
  
}
const mapStateToProps = (state, ownProps) => {
console.log("afters" + state.search)
  return {
    search: state.RootReducer2.search
  };
};

export default connect(mapStateToProps)(afterSearch);
